import React from 'react'
import test_image from './imgs/hibrid/toyota_hibrid_active.png'

const CarCard = () => {
  return (
    <div className="car_card">
      <h1> Toyota Corolla Sedan Comfort</h1>
      <img src={test_image} alt="" className="car_card_image" />
    </div>
  )
}

export default CarCard
